import React from "react"
import styled from "styled-components"

const Header = () => {
    return(
        <HeaderStyle>
            <Div>
                <Home>Home </Home>
                <span style={{color:'rgb(165, 170, 177)' }}>/ </span>
                <span style={{color:'rgb(165, 170, 177)'}}>Ações</span>
            </Div>  

            <div>
                <h1 style={{padding: '25px 0px 27px 0px', color: 'white'}}>Todas as Ações</h1>
            </div>
        </HeaderStyle>
    )
}

const HeaderStyle = styled.header`
    background-color: #173e5b;
    padding: 0px 18% 0px 18%;
`

const Home = styled.span`
    color:rgb(165, 170, 177);
    cursor: pointer;

    &:hover{
        transition: 0.2s ease-in-out;
        color: white;
    }
`

const Div = styled.div`
    padding: 20px 0px 5px 0px; 
    border-bottom: solid #ccc 1px;
`

export default Header
